import React from 'react';


function Footer() {
    return (
        <div className="footer">
            Follow us
            <table>
                <tr>
                    <a href="https://www.instagram.com/chester.cervantes/">
                        <img 
                            src="glyph-logo_May2016.png"           
                            style={{
                                height: 30,
                                width: 30
                            }}
                        />
                    </a> 
                </tr>
            </table>
        </div>
    );
}

export default Footer;
